import logo from './logo.svg';
import './App.css';
import { Component } from 'react';

function Halo(props) {
  return(
    <div>
      <h1>Halo, apakabar {props.name}?</h1>
    </div>
  )
}

class Menyapa extends Component{
  render = (props) =>{
    return(
      <div>
        Halo, saya menyapa {this.props.name}
      </div>
    )
  }
}

function Hitung(props) {
  return(
    <div>
      Hasil dari {props.a1} + {props.a2} = {parseInt(props.a1) + parseInt(props.a2)}
    </div>
  )
}

function App() {
  return (
    <div className="App">
      <Hitung a1="10" />
    </div>
  );
}

export default App;
